import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import MentorList from './components/MenteeList';
import MenteeList from './components/MentorList';
import './styles/App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <header>
          <h1>MentorConnect</h1>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/mentors">Mentors</Link></li>
              <li><Link to="/mentees">Mentees</Link></li>
            </ul>
          </nav>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/mentors" element={<MentorList />} />
            <Route path="/mentees" element={<MenteeList />} />
          </Routes>
        </main>
        <footer>
          <p>&copy; 2025 MentorConnect</p>
        </footer>
      </div>
    </Router>
  );
}

function HomePage() {
  return (
    <section className="hero">
      <h2>Connect with Experienced Mentors and Eager Mentees</h2>
      <p>Find the guidance you need or share your expertise with others.</p>
      <div className="buttons">
        <Link to="/mentors" className="button primary">Find a Mentor</Link>
        <Link to="/mentees" className="button secondary">Find a Mentee</Link>
      </div>
    </section>
  );
}

export default App;
